import Header from './components/Header';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
// import Chat from './Chat';
import Main from './Main';

function App() {

  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<Main />}>
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
